import styles from "./App.module.css";
import NavBar from "./components/Nav/NavBar";
import FullWidthSection from "./components/FullWidthSection";
import CentralSection from "./components/CentralSection";
import SpanButton from "./components/SpanButton";
import BlackFade from "./components/BlackFade";

function App() {
  return (
    <div className={styles.App}>
      <NavBar />
      <div className={styles.navbarSpacer}></div>
      <div className={styles.panelsSpanText}>
        Residential solar installations, pre-wiring, and consultation for
        off-grid and grid-tied applications.
      </div>
      <BlackFade>
        <FullWidthSection>
          <div className={styles.panelsSpan}></div>
        </FullWidthSection>
      </BlackFade>
      <CentralSection>
        <SpanButton color="var(--buttonSecondary)">
          Request Free Solar Quote!
        </SpanButton>
      </CentralSection>
    </div>
  );
}

export default App;
